import React, { Component } from "react";
import "./App.css";
import "./Components/QuoteBox";
import QuoteBox from "./Components/QuoteBox";

class App extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div id="quoteBox">
        <h1>Metal Quote Generator</h1>
        <QuoteBox />
      </div>
    );
  }
}

export default App;
